create table Item (
	id integer primary key,
	name text,
	highAlch integer,
	currentPrice integer,
	buyLimit integer,
	isMembers integer,
	isFavorite integer
);



update Item 
set isFavorite = 0,
    currentPrice = 0,
    isMembers = COALESCE(isMembers, 0),
    highAlch = COALESCE(highAlch, 0),
    buyLimit = COALESCE(buyLimit, 0);